INSERT INTO `static_mods` (`id`, `image`, `title_en`, `title_ru`, `description_en`, `description_ru`, `file_name`, `tested_ver`, `dlc`, `external_link`, `active`, `sort`, `game`, `created_at`, `updated_at`) VALUES
(1, '1542609437_volvoFH16xxx63_1519130717.jpg', 'All trucks with Volvo FH 750hp engine', 'Все грузовики с двигателем 750л.с. от Volvo FH', 'Once you installed the mod, go to any truck dealer and find there a 750hp truck', 'После установки мода, необходимо посетить любого автодиллера и найти там нужный грузовик с уже установленным двигателем на 750 л.с.', '1550433939_All_trucks_with_Volvo_FH_750hp_engine.scs', '1.34', NULL, NULL, 1, 1, 'ets2', '2018-11-19 04:37:17', '2019-02-17 18:05:39'),
(2, '1543410119_43-in-studio-13062-002m2_1527582553.jpg', 'All trucks with Scania S 730hp engine', 'Все грузовики с двигателем 730л.с. от Scania S', 'Once you installed the mod, go to any truck dealer and find there a 730hp truck', 'После установки мода, необходимо посетить любого автодиллера и найти там нужный грузовик с уже установленным двигателем на 730 л.с.', '1550434151_All_trucks_with_Scania_S_730hp_engine.scs', '1.34', NULL, NULL, 1, 2, 'ets2', '2018-11-28 11:01:59', '2019-02-17 18:09:11'),
(3, '1543411522_C10399679_1519130673.jpg', 'All trucks with 625hp Caterpillar C15', 'Все грузовики с двигателем 625л.с. Caterpillar C15', 'Once you installed the mod, go to any truck dealer and find there a 625hp truck', 'После установки мода, необходимо посетить любого автодиллера и найти там нужный грузовик с уже установленным двигателем на 625 л.с.', '1543411523_All_trucks_with_625hp_Caterpillar_C15.scs', '1.34', NULL, NULL, 1, 3, 'ats', '2018-11-28 11:25:23', '2019-02-17 18:09:24'),
(4, '1543412755_17.jpg', 'Black grill for Volvo FH 2012', 'Черная решетка на новую Volvo', 'This mod makes black grill default for all of Volvo FH engines.\r\n(Do not change anything on the truck in MP, otherwise grill will reset)', 'Этот мод делает чёрную решетку дефолтной для всех двигателей Volvo FH.\r\n(В мультиплеере после замены любой детали грузовика в сервисе, решетка заменится на стандартную)', '1543412755_Black_grill_for_Volvo_FH_2012.scs', '1.34', NULL, NULL, 1, 4, 'ets2', '2018-11-28 11:45:55', '2019-02-17 18:09:20'),
(6, '1555323370_h2u8u2Q.jpg', 'Additional Customisation  By Forerunner﻿', 'Additional Customisation  By Forerunner﻿', 'This is a mod/tool that allows people with little or no save editing experience to create trucks and trailers with the same level of customisation that save editing usually offers, it is also easier and quicker than making a customised truck or \r\n trailer by save editing.\r\nThis mod allows you to create a modified or hybrid truck in-game and then go into multiplayer without the need for a converter.', 'Это мод, который позволяет людям с небольшим или нулевым опытом редактирования сохранений кастомизировать грузовики и трейлеры с тем же уровнем настройки, который обычно предлагает редактирование сохранения, это также проще и быстрее, чем создание индивидуального грузовика или трейлера путем редактирования сохранения.\r\nЭтот мод позволяет создавать в игре модифицированный или гибридный грузовик, а затем переходить в мультиплеер без необходимости в конвертации.', NULL, '1.34', NULL, 'https://forum.truckersmp.com/index.php?/topic/56300-additional-customisation-mod-successor-to-ultimate-mp-truck-customisation/', 1, 5, 'ets2', '2019-04-15 07:13:24', '2019-04-16 09:14:38');
